import { desc } from '@utils'
import { get } from '@utils/crypto'

const AES =
  // eslint-disable-next-line max-len
  ''

const DS = JSON.parse(get(AES))

export const LIST = Object.keys(DS)
  .map(key => {
    const item = DS[key]
    if (item == 1) {
      return {
        data: key,
        weight: 10
      }
    }

    const [, weight] = item.split('|')
    // weight = Number(weight)
    // if (weight >= 300) {
    //   weight = 300
    // } else if (weight >= 200) {
    //   weight = 200
    // } else if (weight >= 100) {
    //   weight = 100
    // } else if (weight >= 50) {
    //   weight = 50
    // }

    return {
      data: key,
      weight: Number(weight)
    }
  })
  .sort((a, b) => desc(a.weight, b.weight))

